class Hello{
	def log;
	def context;
	def testRunner;

	def Hello(log, context, testRunner){
		this.log = log
		this.context = context
		this.testRunner = testRunner
	}

	def sayHello(String name) {
		log.info('Hello ' + name)
	}
}

context.setProperty('Hello', new Hello(log, context, testRunner))

// call from the same testcase
def testStep = testRunner.testCase.getTestStepByName("Hello")

testStep.run(testRunner, context)

context.Hello.sayHello("Jason")

// call from a different testcase
project = testRunner.testCase.testSuite.project;
testCase = project.testSuites["TestSuite3"].testCases["TestCase1"];
testStep = testCase.getTestStepByName("Hello");

testStep.run(testRunner, context)

context.Hello.sayHello("Jason")

// calling teststep from the same testcase
def status = testRunner.runTestStepByName("CountryISOCode")
log.info(" >>> " + status)
def result = status.getStatus().toString();
log.info(" >>> " + result)

if(result == "OK"){
	log.info(" >>> Calling teststep from the same testcase passed")
}else {
	log.ingo(" >>> Calling teststep from the same testcase failed")
}

// call teststep from a different testcase
project = testRunner.testCase.testSuite.project;
testCase = project.testSuites["TestSuite3"].testCases["TestCase2"];
testStep = testCase.getTestStepByName("GetCountryISOCode")
def newStatus = testStep.run(testRunner, context)
def newResult = newStatus.getStatus().toString();
log.info(" >>> result from another test case " + newResult)

def suite = context.testCase.testSuite.project.testSuites["TestSuite2"];
// null is property, false is synchronous
suite.run(null, false);

log.info("      >>>      " + suite.getName().toString() + " - Executed Successfully")

def projectName = testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1");
def runStatus = projectName.run(null, true);
Thread.sleep(5000);
log.info("     >>>     status is: " + runStatus.getStatus().toString());

def testCase = testRunner.testCase.testSuite.testCases["TestCase2"];
def prop = new com.eviware.soapui.support.types.StringToObjectMap();
runner = testCase.run(prop, false);

log.info(" >>> " + runner.getStatus().toString())

// log all the test cases
def testCases = context.testCase.testSuite.getTestCaseList()
testCases.each{
	log.info(it.name)
	if(it.name == "TestCase3"){
		log.info("This is TestCase3")
	}
}

log.info(" Test case name is : " + testRunner.testCase.name)
